import React from 'react'

import './AboutInforItemStyle.css'

export default function AboutInforItem({
    title = 'Title',
    items = ['HTML', 'CSS']
}) {
  return (
    // <div className='about_info_container'>
    <>
    <p className="title">{title}</p>
        <div className="items">
            {items.map((item, index) => (
            <div className="item" key={index}>
              <div className='inner'>
                <p>{item}</p>
                </div>
            </div>
            ))}
        </div>
    </>
        
    // </div>
  )
}
